Renowned supermodels Gigi Hadid and Bella Hadid, who have been vocal in their support for the Palestinian cause, are facing a barrage of death threats and harassment due to their criticism of the Israeli government's actions amid the ongoing Israeli military offensive in Gaza.

Born to a Palestinian father, luxury real-estate developer Mohamed Hadid, the Hadid sisters have been actively advocating for the rights of Palestinians in the ongoing conflict.

According to sources, the Hadid family has been compelled to take security measures, including changing their phone numbers, in response to the alarming number of death threats they have received.

