It was an incredible honor to have been invited to the Republican Women‚Äôs annual Gala honoring the Wyoming Army National Guard. 
Not only was I coined by U.S. Senator John Barasso, but I had the opportunity of being a guest speaker! 

What made this night so special was having the chance to share my life‚Äôs story before a large audience including my dad who attended the appearance with me‚Ä¶ AND who was also recognized by Senator Barasso for working hard as the Mayor of the City of Sheridan, Wyoming! 

If there‚Äôs one thing I‚Äôve learned about from opportunities like this, it‚Äôs that there IS room at the table for different + unique! While some of the other honored speakers spoke to matters of hardship and war conflict, I spoke about Army + pageantry + music. At first, I was extremely intimidated thinking my story was too fluffy or that it simply didn‚Äôt measure up or belonged in that space‚Ä¶but to my surprise it really did. There‚Äôs room for you + your story! 

A sincere thanks to everyone who made this possible, I am extremely grateful to be a representative of the state of Wyoming and to women around the world. It was a privilege to sit among Senator Barasso and SFC Smith who is shown in one of my photos along with his beautiful daughters‚Ä¶who loved the crown + sash ü§© may all their dreams come to life! 

A lot of exciting opportunities unfolding this season ‚Äî stay tune! 

